	handleCompleteButtonPress: function () {
		window.localStorage.removeItem(g_ordnum + "_" + g_actnum);
		window.localStorage.setItem(g_ordnum + "_" + g_actnum, "COMP");
		filterClosedJobs();
		filterOpenJobs();
		writeToFileMOB03COMP(g_ordnum  ,  g_actnum);
		//drop3TRQ(g_ordnum + "_" + g_actnum, "COMP");
		drop3TRQ(g_ordnum + "_" + g_actnum, "COMP");
		sap.ui.getCore().byId("myApp").back();
		sap.ui.getCore().byId("MOB03SplitApp").backDetail();
		sap.m.MessageToast.show(sap.ui.getCore().getModel("i18n").getResourceBundle().getText("MOB04CompleteMessage"));
	},
	
	
